() => {

		if (selectPartner.selectedOptionValue == null) {
			return
		}
		var ret = appsmith.store.ASNFormatted
		ret[TableInboundShipments.selectedRowIndex].owner = selectPartner.selectedOptionLabel
		ret[TableInboundShipments.selectedRowIndex].ownerId = selectPartner.selectedOptionValue
		storeValue('ASNFormatted', ret)
		closeModal("modalAssignOwner")
		return ret
	}

